import { VISUALIZZA_PRENOTAZIONI } from "../actions/type";

const INITIAL_STATE = {
  prenotazione: [],
  prenotazioni: {},
  error: null,
};

export default (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case VISUALIZZA_PRENOTAZIONI:
      return {
        ...state,
        prenotazione: [action.payload],
      };
    default:
      return state;
  }
};
